angular.module('portfolio').directive("drawing", function () {
  return {
    restrict: "E",
    templateUrl: './app/directives/drawing/drawing.html',
    controller: function controller($scope) {

      $scope.isDrawing = false;
      $scope.drawingArr = [];
      $scope.lineArr = [];
      $scope.dot;

      $scope.drawingArr.push($scope.lineArr);

      $scope.singleClick = function () {
        $scope.dot = {
          x: event.offsetX,
          y: event.offsetY
        };
        $scope.lineArr.push($scope.dot);
      };
      $scope.startDraw = function () {
        $scope.isDrawing = true;
      };
      $scope.stopDraw = function () {
        $scope.isDrawing = false;
        $scope.drawingArr.push($scope.lineArr);
        console.log("drawingArr: ", $scope.drawingArr);
      };
      $scope.lineDraw = function () {
        if ($scope.isDrawing) {
          $scope.dot = {
            x: event.offsetX,
            y: event.offsetY
          };
          $scope.lineArr.push($scope.dot);
        } else {
          return false;
        }
      };

      //END OF CONTROLLER
    }
  };
});
'use strict';

angular.module('portfolio').directive('gameDir', function () {

  return {
    restrict: 'E',
    templateUrl: './app/directives/gameDir/gameDir.html',
    controller: function controller($scope, $state, $timeout, mainService) {

      $scope.pause = false;
      $scope.gameOver = false;
      $scope.newGame = true;
      $scope.startGame = false;

      $scope.coord = {
        x: 20,
        y: 20
      };
      $scope.fruit = {
        x: 0,
        y: 0
      };
      $scope.tail = [$scope.coord];
      $scope.score = 0;
      $scope.dist = 20;
      $scope.left = 37;
      $scope.up = 38;
      $scope.right = 39;
      $scope.down = 40;
      $scope.dir = "right";
      $scope.speed = 100;

      // VARIABLES ABOVE ^^^^^^^^^^^

      // FUNCTIONS BELOW

      $scope.newFruit = function () {
        $scope.fruit.x = Math.floor(Math.random() * 23 + 1) * 20;
        $scope.fruit.y = Math.floor(Math.random() * 23 + 1) * 20;
      };

      $scope.moveDude = function (keyCode) {
        if ($scope.gameOver) {
          return false;
        }
        if ($scope.startGame) {} else {
          $scope.startNewGame();
        }
        var currentDir = $scope.dir;
        if (keyCode == $scope.left && currentDir !== "right") {
          $scope.dir = "left";
        } else if (keyCode == $scope.up && currentDir !== "down") {
          $scope.dir = "up";
        } else if (keyCode == $scope.right && currentDir !== "left") {
          $scope.dir = "right";
        } else if (keyCode == $scope.down && currentDir !== "up") {
          $scope.dir = "down";
        } else if (keyCode == 32) {
          if ($scope.pause) {
            $scope.pause = false;
            $scope.startNewGame();
          } else {
            $scope.pause = true;
          }
        }
      };

      $scope.direction = function () {
        $scope.newCell = {
          x: $scope.tail[0].x,
          y: $scope.tail[0].y
        };
        // console.log(" ");
        // console.log("newCell: ",$scope.newCell);
        if ($scope.pause) {
          return false;
        }
        var currentX = $scope.tail[0].x;
        var currentY = $scope.tail[0].y;
        if ($scope.dir == "left") {
          currentX -= $scope.dist;
          if (currentX < 0) {
            $scope.gameOver = true;
            // $scope.startGame = false;
            return false;
          }
        } else if ($scope.dir == "up") {
          currentY -= $scope.dist;
          if (currentY < 0) {
            $scope.gameOver = true;
            // $scope.startGame = false;
            return false;
          }
        } else if ($scope.dir == "right") {
          currentX += $scope.dist;
          if (currentX >= 500) {
            $scope.gameOver = true;
            // $scope.startGame = false;
            return false;
          }
        } else if ($scope.dir == "down") {
          currentY += $scope.dist;
          if (currentY >= 500) {
            $scope.gameOver = true;
            // $scope.startGame = false;
            return false;
          }
        }
        $scope.newCell = {
          x: currentX,
          y: currentY
        };
        for (var i = 0; i < $scope.tail.length; i++) {
          if ($scope.newCell.x === $scope.tail[i].x && $scope.newCell.y === $scope.tail[i].y) {
            $scope.gameOver = true;
            // $scope.startGame = false;
            return false;
          }
        }

        $scope.tail.unshift($scope.newCell);

        if ($scope.newCell.x == $scope.fruit.x && $scope.newCell.y == $scope.fruit.y) {
          $scope.score += 100;
          $scope.speed -= 1;
          $scope.newFruit();
        } else {
          $scope.tail.pop();
        }
        $scope.startNewGame();
      };

      $scope.startNewGame = function () {
        $scope.startGame = true;
        $timeout($scope.direction, $scope.speed);
      };
    }
  };
});
